import React from "react";
import { fname, lname } from "./ContextApi";

const compC = () => {
    return (
        <fname.Consumer>
            {(value) => {
                return (
                    <lname.Consumer>
                        {(val) => {
                            return (
                                <h1>Hello, {value} {val}</h1>
                            );
                        }}
                    </lname.Consumer>
                );
            }}
        </fname.Consumer>
    );
}

export default compC;
